/* ==== Step Number Block ==== */
function StepNumber({ num, color, bg }) {
  return (
    <div
      className="flex-shrink-0 flex items-center justify-center w-[110px] h-[110px] rounded-[24px] sm:w-[115px] sm:h-[115px]"
      style={{
        background: bg,
      }}
    >
      <span
        className="text-[82px] font-medium"
        style={{
          color: color,
          opacity: 0.21,
          WebkitTextStroke: `2px ${color}`,
          textStroke: `2px ${color}`,
        }}
      >
        {num}
      </span>
    </div>
  );
}

/* ==== Step Panel ==== */
function StepPanel({ title, desc, color, panelBg, svg }) {
  return (
    <div
      className="relative flex-1 min-w-[250px] max-w-[1035px] h-[189px] flex items-center pl-8 pr-16 py-8 rounded-[14px] overflow-hidden"
      style={{
        background: panelBg,
        border: `1.5px solid ${color}33`,
      }}
    >
      <div className="z-10">
        <div className="text-white font-['Graphikthin'] font-medium text-[22px] sm:text-[36px] leading-[1.15] mb-2">
          {title}
        </div>
        <div className="text-white font-['Graphikthin'] text-[16px] opacity-80">
          {desc}
        </div>
      </div>
      <div className="absolute right-5 top-1/2 -translate-y-1/2 z-0 opacity-75">
        {svg}
      </div>
    </div>
  );
}

